  "title": {
    "nb": "Regnskap og budsjett drift 2017 Stavanger"
  },
  "description": {
    "nb": "Stavanger Kommune fører KOSTRA-regnskap. Les om KOSTRA påhttps://www.regjeringen.no/no/tema/kommuner-og-regioner/kommuneokonomi/kostra/id1233/Regnskapet består av 6 datasett:-Driftsregnskaps- og Budsjettall- Investeringsregnskaps- og Budsjettall- Artskontoplan, med kobling mot KOSTRA-Art- Ansvarskontoplan- Prosjektkontoplan- \"Fri dimensjon\"-kontoplanDrifts- og Investeringsregnskap og Budsjett er fordelt på 5 dimensjoner:- Art- Ansvar- KOSTRA-funksjon- Prosjekt- Fri dimensjonRegnskap og budsjett er fordelt på perioder. Tallene er ikke akkumulerte. Det er ikke sum-linjer per dimensjon.(Eks. ønsker du å vite hvor mye som er brukt på mat de 4 første måneder, summerer du sammen alle linjer med Art 11150, og periode 1,2,3,4, uavhengig hva som er fylt ut i de resterende konteringsdimensjoner.)"
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eStavanger Kommune fører KOSTRA-regnskap. Les om KOSTRA på\u003ca href\u003d\"https://www.regjeringen.no/no/tema/kommuner-og-regioner/kommuneokonomi/kostra/id1233/\" rel\u003d\"nofollow\"\u003ehttps://www.regjeringen.no/no/tema/kommuner-og-regioner/kommuneokonomi/kostra/id1233/\u003c/a\u003e\u003cbr\u003eRegnskapet består av 6 datasett:\u003cbr\u003e-Driftsregnskaps- og Budsjettall\u003cbr\u003e- Investeringsregnskaps- og Budsjettall\u003cbr\u003e- Artskontoplan, med kobling mot KOSTRA-Art\u003cbr\u003e- Ansvarskontoplan\u003cbr\u003e- Prosjektkontoplan\u003cbr\u003e- \"Fri dimensjon\"-kontoplan\u003cbr\u003eDrifts- og Investeringsregnskap og Budsjett er fordelt på 5 dimensjoner:\u003cbr\u003e- Art\u003cbr\u003e- Ansvar\u003cbr\u003e- KOSTRA-funksjon\u003cbr\u003e- Prosjekt\u003cbr\u003e- Fri dimensjon\u003cbr\u003eRegnskap og budsjett er fordelt på perioder. Tallene er ikke akkumulerte. Det er ikke sum-linjer per dimensjon.\u003cbr\u003e(Eks. ønsker du å vite hvor mye som er brukt på mat de 4 første måneder, summerer du sammen alle linjer med Art 11150, og periode 1,2,3,4, uavhengig hva som er fylt ut i de resterende konteringsdimensjoner.)\u003c/p\u003e"
