  "title": {
    "nb": "Levekår Stavanger: Barn i lavinntektshusholdninger EU50"
  },
  "description": {
    "nb": "Alle datasett som danner grunnlaget for levekårsundersøkelsen, har en tittel som begynner med Levekår Stavanger:EU50 : Årlig lavinntektsgrense settes lik 50% av median inntekt etter skatt per forbruksenhet. Ved beregning av vedvarende lavinntekt over en periode på tre år, settes lavinntektsgrensen lik 50 eller 60 prosent av mediangjennomsnittet i treårsperioden. Ved beregning av vedvarende lavinntekt over en fireårsperiode, ansees personer under den årlige lavinntektsgrensen og som var under lavinntektsgrensen i minst to av de tre foregående årene som personer med vedvarende lavinntekt. Inntekt etter skatt per forbruksenhet er lik summen av husholdningens skattepliktige og skattefrie inntekter, fratrukket skatt, fordelt på antall forbruksenheter i husholdningen. Antall forbruksenheter er beregnet ved bruk av EUs ekvivalensskala, der første voksne får vekt lik 1, neste voksne vekt lik 0,5, mens hvert barn får vekt lik 0,3. En husholdning på to voksne og to barn har dermed 2,1 forbruksenheter i følge EU-skalaen."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eAlle datasett som danner grunnlaget for levekårsundersøkelsen, har en tittel som begynner med Levekår Stavanger:\u003cbr\u003eEU50 : Årlig lavinntektsgrense settes lik 50% av median inntekt etter skatt per forbruksenhet. Ved beregning av vedvarende lavinntekt over en periode på tre år, settes lavinntektsgrensen lik 50 eller 60 prosent av mediangjennomsnittet i treårsperioden. Ved beregning av vedvarende lavinntekt over en fireårsperiode, ansees personer under den årlige lavinntektsgrensen og som var under lavinntektsgrensen i minst to av de tre foregående årene som personer med vedvarende lavinntekt. Inntekt etter skatt per forbruksenhet er lik summen av husholdningens skattepliktige og skattefrie inntekter, fratrukket skatt, fordelt på antall forbruksenheter i husholdningen. Antall forbruksenheter er beregnet ved bruk av EUs ekvivalensskala, der første voksne får vekt lik 1, neste voksne vekt lik 0,5, mens hvert barn får vekt lik 0,3. En husholdning på to voksne og to barn har dermed 2,1 forbruksenheter i følge EU-skalaen.\u003c/p\u003e"
