  "title": {
    "nb": "Venteliste barnehage Stavanger"
  },
  "description": {
    "nb": "Noen kommentarer til datasettet:• Feltet «Alt.nr» viser hvilket alternativ den søkte barnehagen var på søknaden. Ved ny søknad kan foresatte velge 4 barnehager i ønsket prioritert (alt.nr) rekkefølge• Alt.nr 5 eller høyere er lagt inn av sentrale brukere i kommunen (for å kunne opprette tilbud på en barnehage som ikke er blant de barnehagene det er søkt på)• En del søknader har to eller flere barnehager med samme alternativ. Dette skyldes at de har endret på opprinnelig søknad og endret rekkefølge på valgte barnehager eller valgt andre barnehager enn opprinnelig lagt inn. Uttrekket klarer ikke å skille på hvilken barnehage av de som har samme alternativ er den siste og aktive, og hvilke som er historiske. • Kommunen har et sett med kriterier som følges i hovedopptak (må ha søkt innen frist og oppfylle kriterier for rett til plass i hovedopptaket, er garantert tilbud om plass), og et sett med kriterier som følges i supplerende opptak (supplerende \u003d løpende opptak gjennom hele året). I datasettet har jeg tatt med søknadsdato, ønsket startdato og alder på barn. Kriterier for årets hovedopptak var blant annet:o Barn må være født senest 30. nov foregående kalenderår (31.11.2017)o Søknadsdato må være innen 1. mars (søknadsfrist)o De må ha ønsket startdato senest 31.12.2018 (inneværende kalenderår)• Feltet «Bydel» er et obligatorisk felt hvor søker kan velge en eller flere bydeler som foretrukket dersom de ikke får tilbud på noen av sine søkte barnehager.• For å kunne skille på de ulike søknadene (barna), har jeg utelatt personnummer og erstattet med løpenummer, hvor hvert barn/søknad har et unikt nummer. Slik kan du skille de ulike søknadene fra hverandre• Jeg har valgt å ta med alle alternativer på søknaden. Dette fordi man har klagerett dersom man ikke får tilbud på sitt første- eller andreønske. Her er det et potensiale å tenke hvordan få søker til å tenke smart på sitt 3. og 4. alternativ for å øke sannsynlighet for å få tilbud på en barnehage hvor de har større mulighet til å få tilbud. Dersom man for eksempel søker på 4 barnehager som det er mange søkere på, er sannsynligheten større for å få tilbud på en barnehage man ikke har på sin søknad, og dermed mindre påvirkningsmulighet på hvilken barnehage de da får tilbud på (annet enn å angi aktuelle bydeler dersom de ikke får tilbud på noen av sine søkte alternativer).Data som ikke er med i uttrekket, er blant annet:• Fødselsdato på barna er ikke med, da jeg ikke er sikker på hvorvidt det kan være med i åpne data. Isteden har du fødselsår på barna, og kan dermed skille på kull (aldersgruppe)• Barnas bostedsadresse• Hvorvidt søknaden er en ny søknad (barn uten plass i barnehage) eller byttesøknader (disse er med i hovedopptaket men siden de allerede har plass i barnehage har de ikke krav på å få byttet barnehage i hovedopptaket). De med rett til plass iht kriteriene uten barnehageplass har krav på få tilbud i hovedopptaket. Av søknadene i datasettet utgjør byttesøknadene 508 søknader. Disse har i regelen kun ett alternativ, nye søknader har oftest alle 4 alternativene.Kriterier:Kommunen og politikerne, i tillegg til lovgivning og nasjonale retningslinjer, styrer hvordan søknadene prioriteres ved tildeling/tilbud om plass. Disse kan derfor endres fra år til år (se https://www.stavanger.kommune.no/siteassets/samfunnsutvikling/planer/temaplaner/barnehageplaner/opptakskriterier_barnehage_oppdatert05.01.2018.pdf).Noen av årets prioriteringer som ikke kan leses ut fra datasettet, er for eksempel barn med spesielle kriterier (som for eksempel barn med prioritet etter $13 i lov om barnehager) eller søskenprioritet.Annen info: Også verdt å merke seg, er at ved tildeling av plass/tilbud om plass kan man velge å beholde søknaden aktiv dersom man ikke får sitt førsteønske, men da blir kun førstealternativet gjenværende på søknaden. Får man tilbud på sitt fjerdeønske og beholder søknaden, «forsvinner» 2. og 3. ønske, og søknaden får status som byttesøknad med kun ett alternativ.I hovedsopptaksperioden er det stengt for å endre på egen søknad, typisk i tidsrommet fom søknadsfrist og ut april."
  },
