  "title": {
    "nb": "Naturtyper - marine (DN-håndbok 19)"
  },
  "description": {
    "nb": "Datasettet viser forekomster av naturtyper som er vurdert som svært viktige (A), viktige (B) og lokalt viktige (C) for biologisk mangfold. Disse lokalitetene befinner seg både innenfor og utenfor områder som er vernet etter naturmangfoldloven/naturvernloven. Utenom verneområdene må disse verdiene ivaretas primært gjennom kommunenes og sektorenes arealforvaltning.\n\nKriteriene for verdisettingen finnes i DN-håndbok 19 Kartlegging av marint biologisk mangfold. Verdisettingen er et viktig hjelpemiddel ved konsekvensutredninger og andre vurderinger som legges til grunn for arealbruk. Marin biomangfoldkartlegging startet i 2000 og og er gjennomført i samarbeid med Fiskeridirektoratet."
  },
