  "title": {
    "nb": "Fiskeriaktivitet - fiskefartøy"
  },
  "description": {
    "nb": "Temaene viser fiskeriaktivitet basert på data fra satellittsporing og fangstrapportering. Sporingsdata er koblet med opplysninger fra fangstrapportering, for å filtrere bort perioder med annen aktivitet enn fiskeri, før generering av linjetetthetsplott.\n\n\nNorske fiskefartøy vises per kvartal.\nAlle fiskefartøy over 15 meter sender posisjonsrapporter til Norsk FMC. I Skagerrak utenfor 4 nautiske mil er grensen 12 meter. Normal sporingsfrekvens er én posisjonsrapport per time. Dekningsgrad er minkende fra breddegrad N76˚ avhengig av type sporingsutstyr.\nNorske fartøy rapporterer uavhengig område, mens utenlandske fartøy kun videresender data når de er i våre farvann: Norges økonomiske sone, Fiskerisonen ved Jan Mayen og Fiskevernesonen ved Svalbard. I Fiskevernsonen mangler vi data fra russiske, britiske og irske fartøy.\n\n\nUtenlandske fiskefartøy vises per år. \nUtenlandske fartøy videresender kun data når de er i våre farvann: Norges økonomiske sone, Fiskerisonen ved Jan Mayen og Fiskevernesonen ved Svalbard. I Fiskevernsonen mangler vi data fra russiske, britiske og irske fartøy (utenfor territoralgrense).\nEU-fartøy rapporterer, tilsvarende de norske, også elektronisk fangstdagbok daglig, mens russiske fartøy kun rapporterer fangst per uke."
  },
