  "title": {
    "nb": "Kvikkleire"
  },
  "description": {
    "nb": "Kartene gir en oversikt over soner med potensiell fare (aktsomhetsområder) for større kvikkleireskred. Sonene er identifisert og avgrenset ved kvartærgeologisk kartlegging (for å identifisere områder med marin leire), geoteknisk vurdering av topografi og grove, geotekniske undersøkelser. Sonene omfatter løsneområder for kvikkleireskred (områder som kan gli ut) og utløpsområder (områder som kan rammes av skredmasser) for nye kartlegginger. For identifiserte soner som kun inneholder løsneområder, må utløpsområdene vurderes særskilt.\nDe identifiserte kvikkleiresonene er klassifisert i tre faregradsklasser (høy-, middels- og lav faregrad), basert på topografiske, geotekniske og hydrologiske kriterier. Sonene er videre klassifisert i tre konsekvensklasser(høy-, middels- og lav konsekvensklasse) avhengig av konsekvenser som et skred i sonen vil ha på bebyggelse og infrastruktur. Sonene er deretter klassifisert i fem risikoklasser, utledet fra faregrads- og konsekvensklassifiseringen."
  },
