  },
  "description": {
    "nb": "Felles kartdatabase er definert av FKB produktspesifikasjonene som vedtas av Geovekst-forum. FKB produktspesifikasjonen består av en generell del som beskriver generelle/felles krav til FKB og i tillegg en produktspesifikasjon for hvert FKB-datasett som beskriver den konkrete datamodellen/datainnholdet. FKB-data er data som følger FKB produktspesifikasjonen. \n\nDatasettene i FKB består av blant annet høyde, vann, markslag (AR5), arealbruk, bygninger, bygningsmessige anlegg, ledninger, veg, jernbane og flyplass."
