  "title": {
    "nb": "Jordsmonn - Dyrkingsklasse Mandelpotet (Oppdal kommune)"
  },
  "description": {
    "nb": "Kartlag i datasettet Jordsmonn som viser arealenes potensial for dyrking av mandelpotet uten bruk av kunstig vanning. Rundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt, med hovedvekt på Sør-Østlandet, Trøndelag og Jæren. Kartlaget Mandelpotet er foreløpig bare tilgjengelig for Oppdal kommune. På enkelte steder er også også innmarksbeite kartlagt. Kartlaget er fremstilt i målestokk 1:5000 og er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. Egenskap som skal brukes til å fremstille kartlaget heter JR_DREN."
  },
