  "title": {
    "nb": "N250 Kartdata med svensk koding lik Översiktskartan"
  },
  "description": {
    "nb": "Datasett lik produktet N250 Kartdata, men har svensk koding i tillegg til den norske kodingen. Kodingen tilsvarer den man finner på datasettet Översiktskartan. Kartverket og Lantmäteriet i Sverige inngikk våren 2015 en samarbeidsavtale om å dele geodata mellom myndigheter, fylker og kommuner på begge sider av den norsk-svenske grensen. Disse dataene er et resultat av dette samarbeidet."
  },
