  "title": {
    "nb": "Terrängkartan - basis geodata for Sverige med norsk koding lik N50 Kartdata"
  },
  "description": {
    "nb": "Basis geodata over Sverige etablert for presentasjon i målestokk rundt 1 : 50 000. Geodataene inneholder blant annet veger, stier, hydrografi, stedsnavn og detaljert beskrivelser av ulike typer skog og mark. \nDatasettet er ikke fullstendig for hele Sverige. Det er ikke dekning i fjellområdene på grensa mot Norge nordover i landet. I disse områdene må Vägkartan benyttes. \nGeodataene er tilrettelagt for norske brukere ved å legge til norsk koding i henhold til datasettet N50 Kartdata. Datasettet er tilrettelagt som en landsdekkende fil, eller som mindre filer med data langs riksgrensa inndelt etter gradnettet. Disse mindre filene vil være kjappere i bruk for brukere som ikke har et landsdekkende behov. \nFormat: ESRI filgeodatabase og SOSI\nProjeksjon: UTM sone 33N, Euref 89"
  },
  "descriptionFormatted": {
