  "description": {
    "nb": "Digital terrengmodell med høyder i et rutenett på 50 x 50 meter. Laget primært på grunnlag av høydeinformasjon fra N50. Høydebærende tema er: høydekurver, høydepunkt, trigpunkt, kyst, innsjøer, veger. Lagret som ruter (\"tiles\") på 100 x 100 km. Navnet på rutene gjenspeiler UTM-koordinatene i nedre venstre hjørne, to siffer for nord- og to siffer for øst-koordinaten.\nStandardavvik i høyde er +/- 4-6 meter.\nDataene dekker fastlands-Norge med øyer. Modellen fortsetter i øst et stykke inn på utenlandsk side med data av usikker kvalitet.\nDette er et datasett som ble produsert i 2007. Det er ikke planlagt oppdateringer av dette datasettet."
