  "title": {
    "nb": "Naturtyper - DN-håndbok 13"
  },
  "description": {
    "nb": "Datasettet viser forekomster av naturtyper som er vurdert som svært viktige (A), viktige (B) og lokalt viktige (C) for biologisk mangfold. Disse lokalitetene befinner seg både innenfor og utenfor områder som er vernet etter naturmangfoldloven/naturvernloven. Utenom verneområdene må disse verdiene ivaretas primært gjennom kommunenes og sektorenes arealforvaltning.\n\nKriteriene for verdisettingen finnes i DN-håndbok 13 Kartlegging av naturtyper - verdisetting av biologisk mangfold. Verdisettingen er et viktig hjelpemiddel ved konsekvensutredninger og andre vurderinger som legges til grunn for arealbruk.\n\nKartleggingen av naturtyper på land og i ferskvann startet i 1999. Kartleggingene er gjort både i regi av kommuner, fylkesmenn og Miljødirektoratet i samarbeid med aktuelle sektorer."
  },
