  },
  "description": {
    "nb": "Landsdekkende datasett som viser en inndeling av landet i 444 landskapsregioner. Avgrensingen av underregionene følger samme prinsipp som for landskapsregioner, men landskapets skala er mer detaljert. Egenskap som skal brukes for å fremstille kartlaget heter RSL_UREG. Mens landskapsregionene er kartfestet og beskrevet, er underregionene kun kartfestet. Presentasjonsregler for Landskapsregioner skal brukes for å presentere Underregioner."
  },
