    "nb": "AR5 viser typer av arealressurser i målestokk 1:5000 i områder under skoggrensen. Datasettet er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. AR5 er avledet fra tidligere markslag i Økonomisk kartverk. Inndelingen i arealtyper er basert på kriterier for vegetasjon, naturlig drenering og kulturpåvirkning. Egenskap som skal brukes til å fremstille kartlaget heter ARTYPE. Areal mindre enn to dekar blir vanligvis ikke skilt ut som egen figur. Jordbruksareal skilles ut ned til 0,5 dekar. Kravet for stedfestingsnøyaktighet er to meter. Areal i kvadratmeter er oppført under AREA_C. Kommunene har ansvar for kontinuerlig ajourhold. Skog og landskap gjør periodisk ajourhold hvert 3. år."
  },
