  },
  "description": {
    "nb": "Istjenesten ved Meteorologisk institutt utarbeider hver virkedag høyoppløselige iskart over den norsk del av Arktis, og ved behov også for Norskekysten f.eks. Oslofjorden. Kartene viser iskonsentrasjon og er basert på en manuell tolkning av ulike satellittdata.Det benyttes i hovedsak væruavhengige Synthetic Aperture Radar data fra Radarsat-2 og Envisat-satellittene. I tillegg til disse dataene brukes visuelle og infrarøde data fra MODIS og NOAA satellitter."
  },
