  "title": {
    "nb": "Kulturminner - Verneverdig tette trehusmiljøer"
  },
  "description": {
    "nb": "Datasettet dekker områder som Riksantikvaren definerer som verneverdig tette trehusmiljøer. \n\nKulturhistorisk verneverdige tette trehusmiljøer der det må tas særskilte brannvernhensyn.\n\nTett bebyggelse med trehus er spesielt sårbar om det skulle oppstå brann. De største områdene med sammenhengende, gammel trehusbebyggelse har vi i byer, for eksempel i Halden sentrum, gamle Stavanger og i store deler av Trondheim. Tette trehusmiljøer finnes imidlertid også på større gårdstun, som Havråtunet i Hordaland, og i gamle fiskevær, som Sør-Gjæslingan i Nord-Trøndelag."
  },
