  "title": {
    "nb": "SAT-SKOG - Alder"
  },
  "description": {
    "nb": "SAT-SKOG er et oversiktskart over skogressursene og gir informasjon om treslag, volum og alder. Tolkingen er basert på bildedata fra jordobservasjonssatellittene Landsat 5 og -7. Bildene sammenstilles med prøveflater fra Landsskogtakseringen, kartdata fra AR5 og terrengmodellen DTM.\n\nAlder måles i antall år, mens SAT-SKOG kartene viser kun tre årsklasser: Ungskog (0 til 40 år), Eldre skog (41 til 80 år), og Gammel skog (over 80 år)."
  },
